import '../index.css';

export default function Home() {
  return (
    <>
      <div className='flex items-center justify-center'>

        <div class="w-1/2 text-center px-4">
          <p class="text-2xl sm:text-3xl md:text-3xl lg:text-3xl xl:text-3xl font-semibold font-sans">
            Hi, I'm Rashed Alaleeli
          </p>
          <p class="text-md sm:text-xl md:text-xl lg:text-xl xl:text-xl font-semibold text-gray-500 ">A frontend developer & Design Enthusiast</p>


          <a href="about.html" class="relative mt-4 inline-flex items-center px-4 sm:px-8 py-2 sm:py-3 overflow-hidden font-medium text-blue-600 border-2 border-blue-600 rounded-md hover:text-white group hover:bg-gray-50">
            <span class="absolute left-0 block w-full h-0 transition-all bg-blue-600 opacity-100 group-hover:h-full top-1/2 group-hover:top-0 duration-400 ease"></span>
            <span class="relative">About Me</span>
          </a>

        </div>
      </div>
    </>

  );
}
